import React, {UseState} from "react";
import LoginRegister from "../LoginRegister/LoginRegister";
import Navigation from "../Home/Navigation";
import Decoration from "../../assets/Decoration.svg";
import {HashLink} from "react-router-";


export default function logout() {

    const[loader, setLoader] = UseState("loading")

return (
   <section className="logout">
        <div className="login-register-nav">

            <Navigation/>
            <LoginRegister/>
        </div>

        <form className="login-register-form">
            <h2>Wylogowanie nastapilo pomyslnie</h2>
            <img src= {Decoration}  alt="decoration" className="decoration" onLoad={() => setLoader('loaded')} />
            {loader === 'loaded' ? <>
        <div className="logout-Button">
            <Link to="/"><button className="btn btn-a">Strona glowna</button></Link>
        </div>
        </> : <></>}
        </form>

   </section>
   ) 
}
